import { Component } from '@angular/core';
import { FormControl, FormGroup, Validators } from '@angular/forms';
import { EmployeeService } from '../../../service/employee.service';
import { ActivatedRoute, Router } from '@angular/router';
import { Help } from '../../../shared/help';

@Component({
  selector: 'app-add-help',
  templateUrl: './add-help.component.html',
  styleUrls: ['./add-help.component.css'],
  template: `
  <input type="text" [(ngModel)]="email" name="email" placeholder="Email" required>
  <button (click)="checkEmail()">Check Email</button>

  <div *ngIf="message" class="message">
    {{ message }}
  </div>
`,
styles: [`
.message {
  padding: 10px;
  background-color: lightgray;
  margin-top: 10px;
}
`]

})

export class AddHelpComponent {
  email!: string;
  message!: string;

  constructor(private employeeservice: EmployeeService, private router: Router) { }

  helpForm: FormGroup = new FormGroup({
    name: new FormControl('',[Validators.required]),
    description: new FormControl('',[Validators.required]),
 
  })

  //EmailVerification

  checkEmail() {
    this.employeeservice.checkEmail(this.email).subscribe(
      (response) => {
        this.message = response.message;
      },
      (error) => {
        console.error('Error checking email:', error);
      }
    );
  }

 ngOnInit(): void {
 
 }
 Category: string[] = ['Restaurant', 'Entertainment', 'Login'];

 cancel(){
   this.router.navigate(['/home'])
 }

    onSubmit(){

     let help = new Help();
     help.name = this.helpForm.value.name;
     help.description = this.helpForm.value.description;
     help.categoryName = this.helpForm.value.categoryName;
         this.employeeservice.AddHelp(help).subscribe(result => {
               this.router.navigate(['/view-help-list'])
         })
 
  this.employeeservice.AddHelp(help).subscribe((res:any) => {

   if(res.statusCode == 200)
   {
     this.router.navigate(['view-help-list'])
   }
   else
   {
     alert(res.message);
   }
  });
      }

}

<div class="container-fluid">
    <div class="row">
        <div class="col-md-2">
            <app-navbar></app-navbar>
        </div>
    <div class="col-md-10 order-md-1">
  <h4>Add Employee</h4>
  <hr>
  <div class="container">
  <div class="row">  
  <form [formGroup]="helpForm" class="form-horizontal"  (ngSubmit)="onSubmit()">
      <div class="form-group">
          <label class=" col-sm-1" style="font-weight: bold;" for="name">Question:</label>
          <div class="col-sm-6">
            <input class="form-control"  placeholder="Enter Question" [required]="true" name="name" formControlName="name">
          </div>
      </div>

      <div class="form-group">
          <label class="col-sm-1"  style="font-weight: bold;" for="description">Answer:</label>
          <div class="col-sm-6">
            <input class="form-control"  placeholder="Enter Answer" [required]="true" name="description" formControlName="description">
          </div>
          <div class="form-group">
            <label class="col-sm-2">Employee Role:</label>
            <div class="col-sm-6">
              <div class="form-control" type="">
                <mat-form-field>
                  <mat-label>Select a name</mat-label>
                  <mat-select>
                    <mat-option *ngFor="let catergoryName of Category" [value]="catergoryName">
                      {{ catergoryName }}
                    </mat-option>
                  </mat-select>
                </mat-form-field>
              </div>
            </div>
        </div>



      </div>
      <div class="form-group">
        <div class="col-sm-offset-1 col-sm-6">
          <button style="margin-right:1em;" type="submit" [disabled]="!helpForm.valid" class="btn btn-sm btn-success">Add</button>
          <button type="button" class="btn btn-sm btn-danger" (click)="cancel()">Cancel</button>
        </div>
      </div>
    </form>
    </div>
  </div> 
    </div>
    </div>
  </div>
